#!/usr/bin/env python3

set1 ={3, 14, 15, 9, 26, 5, 35, 9}
set2 ={60, 22, 14, 0, 9}
print( set2 & set1)
print( set1 ^ set2)
print( set1 | set2)
nt_count = {}
dna = ""

unique = set(dna)

print('unique nt: ', unique) ## {'C', 'A', 'G', 'T', 'N'}

# iterate through each unique nucleotide
for nt in unique:
  # count the number of this unique nt in dna
  count = dna.count(nt)

  # add our count to our dict
  nt_count[nt] = count

print('nt count:', nt_count)


